import React  from "react";

const Rank =(user)=>{
    return (
        <div className='white f3 center'>
             <div className='white f3'>
                 {user.name}
                 {' your rank is '}
             </div>
             <div className="white f3">
                 {user.rank}
             </div>
        </div>
    );
}
export default Rank;
